	setAllValues({...allValues, [e.target.name]: e.target.value})
	console.log(allValues.Fruit)
 }
 useEffect(()=>{
	 console.log(allValues.Fruit)
 })
 return (
	 <div>
	<form>
	<input type="text"
		name="Fruit"
		placeholder="Fruit"
		onSubmit={changeHandler}
	/>
	<input type="number"
	name="Price"
	placeholder="Price"
	onSubmit={changeHandler}
/>
<input type="submit" value="Submit" />
</form>
</div>
 )}
